All songs written by Jen Trynin.

   1. &quot;Happier&quot;
   2. &quot;Better Than Nothing&quot;
   3. &quot;Everything Is Different Now&quot;
   4. &quot;One Year Down&quot;
   5. &quot;Snow&quot;
   6. &quot;All This Could Be Yours&quot;
   7. &quot;Too Bad You're Such A Loser&quot;
   8. &quot;Knock Me Down&quot;
   9. &quot;If I Had Anything To Say (Don't You Think I Would Have Said It All?)&quot;
  10. &quot;Beg&quot;
  11. &quot;Do It Alone&quot; 

Cockamamie is the debut album from Boston, Massachusetts-based musician Jen Trynin. Released in 1995 to generally positive acclaim, the album failed to do well on the charts.
